import Card from './Card';
import './App.css';

class App extends Component {
  constructor (props) {
    super (props); 

    this.state = {
      cardState : 0,  // 0 , 1 , 2
      cardId: [1,2,3,4,5]
    }

    //this.check = this.check.bind(this);
